import React, {useState} from "react";
import {faCheck} from '@fortawesome/free-solid-svg-icons'
import {FontAwesomeIcon } from "@fortawesome/react-fontawesome"


export default function Todo({todoText}){

    return(
        <section id="todo" className="max-w-90 mx-auto" >
            <div className="flex flex-row items-center">
                <div className="m-2 border w-1/3 rounded border-red-800 p-2 mr-4">
                    <div>
                        <h2 className="text-3xl">{todoText}</h2>
                    </div>

                </div>
                <div className=" m-2 border w-1/3 rounded border-transparent p-2">
                    <h3 className="opacity-70 text-xl">Description</h3>
                </div>
                <div className=" m-2  flex flex-col items-end border w-1/3 rounded border-transparent p-2">
                    <div className="rounded-full self-end border border-black h-10 w-10">

                    </div>
                    {/* <FontAwesomeIcon icon={faCircle} className="text-white border-red-800 border text-4xl "/> */}
                    {/* <div className="rounded-full self-end bg-green-600  h-10 w-10 flex-col justify-center"> */}

                    {/*         <FontAwesomeIcon icon={faCheck} className="text-white text-center text-3xl pt-2"/> */}

                    {/* </div> */}
                </div>
            </div>
            <span className="bg-main-black shadow-md w-full h-px inline-block"></span>
        </section>
    );

}
